  false,\n\t\"url\": null,\n\t\"notes\": \"These data are the total number and average
  number of saplings and seedlings of trees detected from 0.05-ha circular plot habitat
  samples taken in 2005 at sample points at Spears and Didion Ranches, Placer County,
  California. Seedlings and saplings were counted from nine 1-square meter (0.56-m
  radius) circular plots located within each 0.05-ha circular habitat sampling plot.
  There were three 0.05-ha circular habitat sampling plots at each of the 15 sample
  points. One 1-square meter plot was located at the center of 0.05-ha plot, and the
  eight remaining plots were located 8 m away from the center point at 45 degree intervals
  in the circular.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
